INSERT INTO node (option) VALUES(NULL,'What is TCG',NULL,4,NULL,NULL);
INSERT INTO node (text) VALUES('Tumisang Ramollo',NULL,NULL,NULL,NULL,NULL);
INSERT INTO node (text) VALUES('The Coding Ground is a software craftsmanship academy that focuses on the science and art of developing software engineers with in-demand technical, leadership, and interpersonal abilities. Our intensive 18-month program teaches students the key skills they’ll need to advance in their professions in information technology while also changing the course of ther life.',NULL,NULL,NULL,NULL,NULL);
INSERT INTO node (option) VALUES(NULL,'Back to top',NULL,NULL,NULL,NULL);
INSERT INTO node (option) VALUES(NULL,'How does the program work?',NULL,4,NULL,NULL);
INSERT INTO node (text) VALUES('Tumisang Ramollo',NULL,NULL,NULL,NULL,NULL);
INSERT INTO node (text) VALUES('Students train for 12 months, full time, using a free online curriculum while receiving the support of graduates and mentors. The last 6 months of training is spent on a practical project, run in a scrum format. Students receive the training, food and a transport stipend for free and at the end of their training, if successful, are placed in a ‘pay it back’ internship in which 60% of their salary goes back into TCG to fund the training of the next year’s students.',NULL,NULL,NULL,NULL,NULL);
INSERT INTO node (option) VALUES(NULL,'Back to top',NULL,NULL,NULL,NULL);
INSERT INTO node (option) VALUES(NULL,'How do students qualify?',NULL,4,NULL,NULL);
INSERT INTO node (text) VALUES('Tumisang Ramollo',NULL,NULL,NULL,NULL,NULL);
INSERT INTO node (text) VALUES('TCG accepts students from previously disadvantaged backgrounds between the ages of 18 - 25. Students are required to have South African citizenship and pass a series of assessments and interviews during the application process. Students are not required to have a matric qualification.',NULL,NULL,NULL,NULL,NULL);
